import React from "react";
import { FaHtml5, FaCss3Alt, FaJs, FaReact, FaSass, FaFigma, FaPhp, FaNodeJs, FaLaravel, FaDatabase, FaDocker, FaPython, FaGitAlt, FaGithub, FaTerminal, FaWordpress } from "react-icons/fa";
import { SiTailwindcss, SiExpress, SiMysql, SiMongodb, SiNextdotjs, SiNginx, SiApache, SiAstro, SiTypescript, SiVisualstudiocode, SiNpm } from "react-icons/si";

const technologies = {
  Frontend: [
    { name: "HTML", icon: <FaHtml5 className="text-orange-500" /> },
    { name: "CSS", icon: <FaCss3Alt className="text-blue-500" /> },
    { name: "JavaScript", icon: <FaJs className="text-yellow-400" /> },
    { name: "ReactJS", icon: <FaReact className="text-cyan-400" /> },
    { name: "TailwindCSS", icon: <SiTailwindcss className="text-teal-400" /> },
    { name: "SASS", icon: <FaSass className="text-pink-400" /> },
    { name: "Figma", icon: <FaFigma className="text-pink-500" /> },
  ],
  Backend: [
    { name: "PHP", icon: <FaPhp className="text-indigo-500" /> },
    { name: "NodeJS", icon: <FaNodeJs className="text-green-500" /> },
    { name: "Laravel", icon: <FaLaravel className="text-red-500" /> },
    { name: "ExpressJS", icon: <SiExpress className="text-gray-200" /> },
    { name: "MySQL", icon: <SiMysql className="text-blue-300" /> },
    { name: "MongoDB", icon: <SiMongodb className="text-green-400" /> },
    { name: "Next.js", icon: <SiNextdotjs className="text-white" /> },
    { name: "Nginx", icon: <SiNginx className="text-green-600" /> },
    { name: "Apache", icon: <SiApache className="text-red-500" /> },
  ],
  Aprendiendo: [
    { name: "Python", icon: <FaPython className="text-yellow-400" /> },
    { name: "Astro", icon: <SiAstro className="text-orange-400" /> },
    { name: "Docker", icon: <FaDocker className="text-blue-400" /> },
    { name: "TypeScript", icon: <SiTypescript className="text-blue-500" /> },
  ],
  Herramientas: [
    { name: "Git", icon: <FaGitAlt className="text-red-500" /> },
    { name: "GitHub", icon: <FaGithub className="text-white" /> },
    { name: "Terminal", icon: <FaTerminal className="text-white" /> },
    { name: "VSCode", icon: <SiVisualstudiocode className="text-blue-400" /> },
    { name: "npm", icon: <SiNpm className="text-red-500" /> },
    { name: "WordPress", icon: <FaWordpress className="text-blue-500" /> },
  ]
};

export default function Technologies() {
  return (
    <section id="technologies" className="py-16 bg-neutral-900 text-white">
      <h2 className="text-3xl font-bold text-center mb-12">Tecnolog√≠as</h2>
      <div className="max-w-6xl mx-auto grid grid-cols-1 md:grid-cols-2 gap-12 px-4">
        {Object.entries(technologies).map(([category, techs]) => (
          <div key={category}>
            <h3 className="text-xl font-semibold mb-4">{category}</h3>
            <div className="grid grid-cols-3 gap-4">
              {techs.map((tech, index) => (
                <div key={index} className="flex items-center gap-2 bg-neutral-800 p-3 rounded-lg hover:bg-neutral-700 transition">
                  <span className="text-2xl">{tech.icon}</span>
                  <span>{tech.name}</span>
                </div>
              ))}
            </div>
          </div>
        ))}
      </div>
    </section>
  );
}
